import React from 'react';
import { useNavigate } from 'react-router-dom';
import useProfileStore from '../../store/profileStore';
import useGenerateProposals from '../../hooks/useGenerateProposals';
import './TeamPage.css'; // Reuse RoomPage.css with minor additions

const TeamPage = () => {
  const navigate = useNavigate();
  const { teams, isGeneratingProposals } = useProfileStore();
  const { generateProposals } = useGenerateProposals();

  return (
    <div className="room-page"> {/* Using same class as RoomPage */}
      <div className="room-header">
        <div className="header-content">
          <div className="room-info">
            <h1>Research Teams</h1>
            <p className="creator-info">
              {teams.length} {teams.length === 1 ? 'team' : 'teams'} formed
            </p>
          </div>
          <div className="header-actions">
            <button 
              onClick={() => navigate('/')} 
              className="secondary-button"
            >
              ‚Üê Back to Home
            </button>
            <button
              onClick={generateProposals}
              className="primary-button"
              disabled={isGeneratingProposals || teams.length === 0}
            >
              {isGeneratingProposals ? (
                <>
                  <span className="loading-spinner"></span> Generating Proposals...
                </>
              ) : (
                'Generate Research Proposals'
              )}
            </button>
          </div>
        </div>
      </div>

      <div className="content-container">
        {teams.length === 0 ? (
          <div className="empty-state">
            <div className="empty-icon">
              <span role="img" aria-label="Team">üë•</span>
            </div>
            <h3>No Teams Formed Yet</h3>
            <p>Create teams from the researcher profiles to get started</p>
            <button 
              onClick={() => navigate('/profiles')} 
              className="primary-button"
            >
              Go to Profiles
            </button>
          </div>
        ) : (
          <div className="teams-grid"> {/* Similar grid to RoomPage */}
            {teams.map((team) => (
              <div key={team.team_id} className="team-card">
                <div className="card-header">
                  <h2>Team {team.team_id}</h2>
                  <span className="team-size-badge">
                    {team.team_size} member{team.team_size > 1 ? 's' : ''}
                  </span>
                </div>

                <div className="card-section">
                  <div className="section-header">
                    <span className="section-icon">üîç</span>
                    <h3>Research Focus</h3>
                  </div>
                  <div className="tags-container">
                    {team.team_research_areas.map((area, idx) => (
                      <span key={idx} className="research-tag">{area}</span>
                    ))}
                  </div>
                </div>

                <div className="card-section">
                  <div className="section-header">
                    <span className="section-icon">üë•</span>
                    <h3>Team Members</h3>
                  </div>
                  <div className="members-list">
                    {team.members.map((member) => (
                      <div key={member} className="member-item">
                        <div className="member-info">
                          <span className="member-name">{member}</span>
                          <div className="member-fields">
                            {team.member_fields[member].map((field, idx) => (
                              <span key={idx} className="field-tag">{field}</span>
                            ))}
                          </div>
                        </div>
                      </div>
                    ))}
                  </div>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default TeamPage;
